fnre[adb_,t_]:=Sum[derv[lc,adb]^2 (\[Phi]ret[lc,t]),{lc,1,28}]


fnim[adb_,t_]:=Sum[derv[lc,adb]^2 (\[Phi]imt[lc,t]),{lc,1,28}]


gnre[adb_,adb1_,t_]:=Sum[derv[lc,adb]*derv[lc,adb1]\[Phi]ret[lc,t],{lc,1,28}]


dcfn[t_,adb_,adb1_]:=Exp[-((fnre[adb,t]+fnre[adb1,t]-2*gnre[adb,adb1,t])+(fnim[adb,t]-fnim[adb1,t]))]


jump[m_,n_]:=Sum[(vector[[m,i]]*conjvec[[i,n]])^2,{i,1,28}]


w[m_,n_]:=energy[[m]]-energy[[n]]


wT=(6.626 10^-34 /(1.3806 10^-23 T 2 N[Pi]\[Tau]c))


specdens[w_,i_]:=2 \[Lambda][i]/\[Gamma]0 4\[Pi] w/(w^2+4 \[Pi]^2)+Sum[2/Pi \[Lambda]nuc[i,j] \[Tau]c \[Gamma]j \[Tau]c ( c 2\[Pi] \[Omega][j])^2 \[Tau]c^2w/(w^2\[Gamma]j^2\[Tau]c^2+(( c 2\[Pi] \[Omega][j])^2 \[Tau]c^2-w^2)^2) ,{j,1,48}]


poplnrate[m_,n_]:=If[m==n,0,If[energy[[m]]>energy[[n]],(Sum[(vector[[m,j]]*conjvec[[j,n]])^2*2 N[Pi]specdens[w[m,n],j],{j,1,14}])/(Exp[ w[m,n]wT]-1),(Sum[(vector[[m,j]]*conjvec[[j,n]])^2*2 N[Pi]specdens[w[n,m],j],{j,1,14}])/(1-Exp[-( w[n,m]wT)])]]


self[n_]:=Sum[If[m==n,0,poplnrate[m,n]],{m,1,28}]


rate=Table[If[m==n,-Chop[self[n]],Chop[poplnrate[m,n]]],{m,1,28},{n,1,28}]


c1=Sqrt[0.81];c2=Sqrt[0.11];c3=Sqrt[0.08];


(* ::Input::Initialization:: *)
popln[m_]:={c1^2 vector[[m,1]]*conjvec[[1,m]]+ 2 c1 c2 vector[[m,1]]*conjvec[[9,m]]+2 c1 c3 vector[[m,1]]*conjvec[[8,m]]+c2^2 vector[[m,9]]*conjvec[[9,m]]+c3^2 vector[[m,8]]*conjvec[[8,m]]+2 c2 c3 vector[[m,9]]*conjvec[[8,m]]}


(* ::Input::Initialization:: *)
coh[m_,n_]:=c1^2 vector[[m,1]]*conjvec[[1,n]]+ 2 c1 c2 vector[[m,1]]*conjvec[[9,n]]+2 c1 c3 vector[[m,1]]*conjvec[[8,n]]+c2^2 vector[[m,9]]*conjvec[[9,n]]+c3^2 vector[[m,8]]*conjvec[[8,n]]+2 c2 c3 vector[[m,9]]*conjvec[[8,n]]


coherence[t_,m_,n_]:=Exp[-1/2(poplnrate[m,n]+poplnrate[n,m])t]*coh[m,n]


init=Table[popln[m],{m,1,28}]


q[t_]:=MatrixExp[ rate t].init


poppp[i_,j_,t_]:=Re[Sum[vector[[m,j]]*conjvec[[i,m]]*vector[[n,i]]*conjvec[[j,n]]*Exp[- I t (energy[[n]]-energy[[m]])],{m,1,28},{n,1,28}]]


poplnew[j_,t_]:=Module[{         },one=Sum[vector[[m,j]]*conjvec[[j,m]]*q[t][[m,1]],{m,1,28}];
two= Sum[vector[[m,j]]*conjvec[[j,n]]*coherence[t,m,n]*dcfn[t,m,n]*Exp[- I t (energy[[n]]-energy[[m]])],{n,1,27},{m,n+1,28}];one+2 Re[two]]


evol[i_]:=Table[{t*1111,poplnew[i,t]},{t,0,9,0.05}]


init


Timing[poplnew[1,18]]


Length[Table[t,{t,0,9,0.05}]]


